script: |
  super -f text -I q3143.spq | sort > q3143.out

inputs:
  - name: q3143.spq
    data: |
      SELECT + col0 AS col2 FROM tab2 (FORMAT parquet) WHERE col2 * + col1 + + col1 * col0 + col0 * + col0 * + col0 NOT IN ( - tab2.col1 + + col1 / - col1 );
  - name: tab2

outputs:
  - name: q3143.out
    data: |
      7
      78
      79
